(13, 12, 'm', 1530058019, 1, 'Quy Lão Kame', 0, 1906799028, 0, 'Chrome/64.4', 'Xin chào các con,\n Sau 1 thời gian vắng bóng thì Mạng Xã Hội Avatar Hiện đại bậc nhất Việt Nam đã trở lại.\n- MTeen.Me cam kết 100% là Mạng xã hội avatar đầu tiên có chức năng ajax 80%.\n- Các tính năng đều được mượt bằng ajax giúp tăng phần thủ vị và giảm thời gian của người chơi.\n\n[b]Trước khi Tham Gia MXH các con cần đọc kĩ những điều nội quy sau [/b]\n\n[b]I,Điều I : Tài Khoản cá nhân và riêng tư [/b]\n\n+ Admin,BQT sẽ không có quyền can thiệp vào tài khoản của các con,các con hãy nhập đúng email,để quên mật khẩu,mọi thường hợp mất nick ta,BQT sẽ không giúp.Các con chỉ có thể lấy mật khẩu qua Email.\n+ Các con phải bảo đảm kĩ lưỡng tài khoản,phòng chống kẻ gian lấy nick đi phá hoại diễn đàn,trò chơi v.v\n+ Sắp tới sẽ cập nhật tính năng Trạng Thái như facebook,sẽ có thể điều chỉnh những người có thể xem stt của mình.\n+ Về những tiền ảo mọi người có trách nghiệm không bug,hack,v.v\n[b]II,Điều II : Về Nội Quy Của Diễn Đàn [/b]\n\n+ mọi thường hợp bug,hack sẽ bị khóa nick vô thời hạn,nếu chỉ lỗi hoặc đưa ra lỗi thì sẽ được ân xá và thưởng.\n+ không súc phạm Admin,người chơi khác.\n+ mỗi người có trách nghiệm tôn trọng những người dùng khác.\n+ Mọi vấn đề không liên quan đến mteen.me như quảng cáo site khác v.v sẽ bị khóa ngay lập tức.\n\n\n[b] VỀ TÍNH NĂNG SẮP TỚI [/b]\n\n+ Hệ thống skill sẽ được rời ra ngày khác.\n+ còn skill bị động thái dương hạ sang,đấm dragon,v.v thì đã ra mắt.\n+ Hệ thống bản đồ kho báu.\n\n          Ta mong MTeen.Me sẽ vững vàng và trường tồn phát triển.', 0, '', 0, 'Bun Ma', 1530083310, 1, '', 9, '', 0, 0, 0, 0, 0, 0),
