(20, 19, 'm', 1530151815, 1, 'Quy Lão Kame', 0, 1906799028, 0, 'Chrome/64.4', 'Xin chào các con,\n Do tính năng auto load 1 số máy yếu dùng MXH không được mượt nên ta cho ra tính năng tắt mở auto load.\n Để sử dụng tính năng này các con hãy làm theo ta :\nBước I : [b] Click vào avatar của các con dưới phần tên trên chỗ đầu trang sẽ hiện ra MENU [/b]\n* những con nào có đệ tự,hay Item thì sẽ hiện ra đó để các con dùng nhanh cho tiện.(hợp thể,dùng item cuồng nộ,bổ huyết v.v cũng ở trên đó luôn)\nBƯỚC II : [b] click vào chữ [big] TẮT/MỞ AUTOLOAD[/big][/b]\n\n* cách này đối với những máy RAM nhỏ hơn 2GB.còn con nào máy trên 2 GB thì cứ để auto load chơi cho trải nghiệm tốt nhất nhé !\n\n\n* Chúc các con chơi vui vẻ.', 0, '', 0, 'Quy Lão Kame', 1530151888, 1, '', 6, '', 0, 0, 0, 0, 0, 0),
