(161, 160, 'm', 1530427485, 1, 'Quy Lão Kame', 0, 250923340, 0, 'Chrome/67.0', 'Chào các con,\nTa đã chuẩn bị 1 số tính năng để sắp tới ra mắt các con,\nSkill thì tối nay or sáng mai ta ra.\nBoss + quái bản đồ cũng vậy.\n\nChức năng ra mắt khi đủ 500 men :\nTính năng sao pha lê :\nNói qua : khi pem boss các con sẽ có cơ hội rớt đồ có sao ( sao trắng)\n- sao pha lê sẽ kiếm đc tại boss,sự kiện v.v\n- các con có thể đập sao pha lê cho đồ tại bà hạt mít ở đảo Hawaii.\n- sao pha lê gồm có :\n+ Phản 5% sát thương\n+ Hút 5% hp\n+ tăng 15% hp ( đồ hiện tại)\n+ tăng 15% sm ( đồ hiện tại)\n+ Tăng 5% xu nhận được khi bán nông sản,pem quái.\n+ Đồ tối đa có 7 sao.\n\nTính năng ra mắt khi 1000 men :\n+ Tính năng mặc đồ cho đệ tử ( đồ trong rương suu phụ )\n Tính năng ra mắt khi 2000 Men:\n + di chuyển ( nhìn thấy người khác di chuyển nhé các con )\nCòn gì tuyệt hơn vừa chát vừa di chuyển\n( Di chuyển đến vị trí như shop,cường hoá sẽ tự vô luôn tính năng đó) ta nói là làm ok.', 0, '', 0, '', 0, 0, '', 3, '', 0, 0, 0, 0, 0, 0),
