INSERT INTO `gamemini_boss_name` (`id`, `name`, `sucmanh`, `time`, `xu`, `luong`, `name_id`, `loaisp`, `name_vp`, `giaban`, `sucmanh_do`, `thongtin`) VALUES
(1, 'Già Làng', 2000, NULL, 10000, 5, 0, '', '', 0, 0, 'Các con mới vào sức mạnh còn yếu, hãy trải qua cuộc huấn luyện của ta đã, nếu qua được thì con sẽ hành tẩu giang hồ được rồi!'),
(2, 'Mabu', 80000, NULL, 20000, 10, 0, '', '', 0, 0, 'KA KA, Ta bá chủ lãnh địa forumviet, Không ai có thể địch nổi ta kẻ nào có gan vào đây ta chấp hết.'),
(3, 'Cell', 120000, NULL, 30000, 15, 0, '', '', 0, 0, 'Ta đã hút được số 17 và số 18 giờ đến lượt các người. Khà Khà'),
(4, 'Tề thiên đại thánh', 400000, NULL, 40000, 20, 1, 'da', 'Kim Cương Xanh', 0, 0, 'Haizz! Năm trăm năm trước ta oai hùng, đại náo hoàng cung, giờ lại phải chịu sự trừng phạt của già làng Forumviet ở đây làm bot. Ai pem đi ta lắm tiền lắm'),
(5, 'Bá Tước Dracula', 800000, NULL, 50000, 25, 2, 'da', 'Kim Cương Hi Vọng', 0, 0, 'Các ngươi có biết là đang đối đầu với chúa tể bóng đêm... Các ngươi sẽ phải trả giá cho sự ngôn cuồng của minh... Hahaha...'),
(6, 'Xác Ướp Pharaon', 1400000, NULL, 60000, 50, 2, 'da', 'Kim Cương Hi Vọng', 0, 0, 'Bất kỳ ai xâm phạm lăng mộ của  ta và các vị vua Ai cập, các Pharaon, thì sẽ phải chịu một lời nguyền.... Lời nguyền này, không loại trừ ai, sẽ đem đến bất hạnh cho người xâm phạm, rủi ro, ốm, chết... Các ngươi có gan cứ tới đây');
