INSERT INTO `radio` (`id`, `user_id`, `text`, `time`) VALUES
(17, 1502, 'Ch&uacute;c to&agrave;n thể ace  1tuần mới,1năm mới vui vẻ :))). Gửi đến ae b&agrave;i h&aacute;t l&agrave;m những g&igrave; m&igrave;nh th&iacute;ch-hồ quang hiếu', 1515043414),
(18, 19553, 'M&igrave;nh muốn gửi lời nhắn n&agrave;y cho to&agrave;n thể ae trong web. Nghe xong ae đừng kh&oacute;c nha bởi v&igrave; Đ&acirc;y l&agrave; lời nhắn rất cảm động. Chống chỉ định cho đ&agrave;n &ocirc;ng c&oacute; thai v&agrave; trẻ em đang cho con b&uacute;. Chuyện l&agrave; thế n&agrave;y. M&igrave;nh viết lời nhắn n&agrave;y xong tay mỏi r&atilde; rời v&agrave; c&acirc;u chuyện kết th&uacute;c tại đ&acirc;y hehe. Thế nh&eacute;! <br />\nĐ&atilde; lỡ y&ecirc;u em nhiều - Justa tee MC phatd gi&uacute;p ạ! Cảm ơn!', 1515047763),
(19, 18398, 'Tao muốn l&agrave;m ck m&agrave;y - Hương Ạ', 1515048325),
(20, 15093, '+ Gửi đến: @11<br />\nad ph&aacute;t cho em b&agrave;i h&aacute;t Đ&atilde; Lỡ Y&ecirc;u Em Nhiều với lời nhắn :  biết t&iacute;nh t rồi th&igrave; nhớ giữ cho chặt nha,để lạc l&agrave; kh&ocirc;ng c&oacute; đường về đ&acirc;u. t sợ một ng&agrave;y t c&oacute; n&oacute;i hơi qu&aacute; lời m lại từ t lu&ocirc;n n&ecirc;n đừng v&igrave; những chuyện nhỏ nhặt m&agrave; bu&ocirc;ng tay nhau,t y&ecirc;u m :D', 1515050302),
(21, 16066, 'Hy vọng ko dk chọn', 1515056857),
(22, 17630, 'e t&ecirc;n l&agrave; thoại. e y&ecirc;u cầu 1 b&agrave;i h&aacute;t giả vờ thương anh được kh&ocirc;ng. với lời nhắn  thời gian đ&ocirc;i ta b&ecirc;n nhau a rất cảm ơn e đ&atilde; cho a những cảm gi&aacute;c hạnh ph&uacute;c như vậy. c&oacute; lẽ ta c&oacute; di&ecirc;n m&agrave; k c&oacute; nợ e nhỉ. a chỉ pit đ&agrave;nh để e ra đi . để e t&igrave;m những thứ e cần v&agrave; những hạnh ph&uacute;c mới . a &ecirc;u e nh&igrave;u', 1515073125),
(23, 15150, 'Thực Sự b&acirc;y giờ..............................................................................................Hết', 1515096960),
(24, 11, 'T muốn gửi b&agrave;i đừng giận anh nữa của the men.. Đến bạn @15093 vs lời nhắn.. D&ugrave; nhiều l&uacute;c. T l&agrave;m m giận...nhưng giận vừa h&ocirc;y....cho t sống c&aacute;i... :v... V&agrave; gửi đến to&agrave;n thể ae tuoiteen... Phụt tất cả bọn m', 1515158825),
(25, 1102, 'Y&ecirc;u cầu của @19553: M&igrave;nh muốn gửi lời nhắn đến T&ugrave;ng ing @6 : H&atilde;y sống theo c&aacute;ch của m&agrave;y, thế nh&eacute;! Cuộc sống của m&agrave;y do m&agrave;y ch&egrave;o l&aacute;i v&agrave; quyết định, h&atilde;y lu&ocirc;n sống y&ecirc;u đời nh&eacute; tml =))<br />\nPh&aacute;t gi&uacute;p b&agrave;i Waiting for love :))', 1516193144),
(26, 0, 'hú', 1532023484),
(27, 0, 'hú', 1532023493),
(28, 0, 'hú', 1532023499);
